            title: e.target.value,
            author: e.target.value
        }
        console.log(input_data);
    }
    return(
        <>
        <input name="title"/>
        <input name="author"/>
        <button type="button" onClick={submit_handler}>Add data</button>
        </>
    )
}

export default App11;
